import { Route } from 'react-router-dom';

import Home from './components/Home';

import './page.scss';


const Page = () => (
  <div className="page">
    <Header />
    <div className="page-content">
      <Route path="/" exact>
        <Home />
      </Route>
    </div>
  </div>
);

export default Page;
